const canvas = document.getElementById('canvas1')
const ctx = canvas.getContext('2d')

const image1= new Image();
image1.src = 'data:image/png;base64,';

class Cell{
    constructor(x,y,symbol,color){
        this.x = x 
        this.y = y
        this.symbol = symbol
        this.color= color
    }
    draw(ctx){
        ctx.fillStyle =this.color
        ctx.fillText(this.symbol,this.x,this.y)
    }
}
class AsciiEffect{
    #imageCellArray = []
    #pixels=[]
    #ctx
    #width
    #height
    constructor(ctx,width,height){
        this.#ctx=ctx
        this.#width= width
        this.#height = height
        this.#ctx.drawImage(image1,0,0,this.#width,this.#height)
        this.#pixels = this.#ctx.getImageData(0,0,this.#width,this.#height)
        console.log(this.#pixels)
    }
    #coverToSymbol(color){
        if(color>250) return '@'
        else if (color>240) return '#'
        else if (color>220) return '$'
        else if (color>200) return '%'
        else if (color>180) return '&'
        else if (color>160) return '*'
        else if (color>140) return 'X'
        else if (color>120) return '='
        else if (color>100) return 'v'
        else if (color>80) return '|'
        else if (color>60) return '!'
        else if (color>40) return ':'
        else if (color>20) return '\''
        else return ''
    }
    #scanImage(cellSize){
        this.#imageCellArray=[]
        for(let y = 0;y<this.#pixels.height;y+=cellSize){
            for(let x= 0;x<this.#pixels.width;x+=cellSize){
                const posX = x * 4;
                const posY = y * 4;
                const pos = (posY*this.#pixels.width)+posX
                if(this.#pixels.data[pos+3]>128){
                    const red = this.#pixels.data[pos]
                    const green=this.#pixels.data[pos+1]
                    const blue=this.#pixels.data[pos+2]
                    const total = red + green + blue
                    const averageColor = Math.floor(total/3)
                    const color = 'rgb('+red + ',' +green+',' + blue +')'
                    const symbol = this.#coverToSymbol(averageColor) 
                    if(total>200) this.#imageCellArray.push(new Cell(x,y,symbol,color))
                }
            }
        }
        console.log(this.#imageCellArray);
    }
    #drawAscii(){
        this.#ctx.clearRect(0,0,this.#width,this.#height)
        for(let i =0;i<this.#imageCellArray.length;i++){
            this.#imageCellArray[i].draw(this.#ctx)
        }
    }
    draw(cellSize){
        this.#scanImage(cellSize)
        this.#drawAscii()
    }
}

image1.onload = function initialize(){
    canvas.width = image1.width
    canvas.height = image1.height
    effect =new AsciiEffect(ctx,image1.width,image1.height)
    effect.draw(10)
}
